n目录）</p>\\\\n<p>2）修改软连接</p>\\\\n<pre><code>#删除原来的软连接\\\\nrm -rf /usr/bin/python3\\\\n\\\\n#建立新的软连接\\\\nln -s /usr/bin/python3.6m /usr/bin/python3\\\\n\\\\n#重新测试python3版本\\\\npython3 -V\\\\n</code></pre>\\\\n<h2><strong>1.7 安装python3.6-dev包</strong></h2>\\\\n<p><code>#用pip安装很多python的package都会依赖python-dev包 sudo apt install -y python3.6-dev</code></p>\\\\n<h2><strong>1.8 pip3安装</strong></h2>\\\\n<p><code>#安装pip3 sudo apt install -y python3-pip  #查看pip3版本  pip3 -V</code></p>\\\\n<p>&nbsp;</p>\\\",\\\"comment_count\\\":0,\\\"uname\\\":\\\"unhejing\\\",\\\"desc\\\":\\\"ubuntu16.04安装python3.6-安装篇\\\",\\\"is_top\\\":0,\\\"head_img\\\":\\\"http://162.14.98.165:3000/images/1658417066260.png\\\",\\\"created_time\\\":\\\"2022-07-24 07:07:54\\\",\\\"updated_time\\\":\\\"2022-07-22 23:59:53\\\",\\\"cname\\\":\\\"Python编程\\\"},{\\\"id\\\":3,\\\"name\\\":\\\"开源项目介绍\\\",\\\"uid\\\":0,\\\"cid\\\":5,\\\"status\\\":1,\\\"view_count\\\":0,\\\"like_count\\\":0,\\\"content\\\":\\\"<p><strong>前言：最近node编写服务端api有点火，比较感兴趣就尝试使用vue3+uniapp+nodejs+express+nestjs写了一个开源项目，供大家学习</strong></p>\\\\n<p>&nbsp;</p>\\\\n<p><strong>1. 开源项目地址： <a href=\\\\\\\"https://gitee.com/unhejing/node-mall\\\\\\\">https://gitee.com/unhejing/node-mall</a></strong></p>\\\\n<p>&nbsp;</p>\\\\n<p><strong>2.项目部分截图</strong></p>\\\\n<p><strong>后台截图</strong></p>\\\\n<p><img src=\\\\\\\"http://162.14.98.165:3000/images/1658410430200.png\\\\\\\" alt=\\\\\\\"\\\\\\\" width=\\\\\\\"1200\\\\\\\" height=\\\\\\\"676\\\\\\\" /></p>\\\\n<p><strong>商品截图</strong></p>\\\\n<p><img src=\\\\\\\"http://162.14.98.165:3000/images/1658410587270.png\\\\\\\" alt=\\\\\\\"\\\\\\\" width=\\\\\\\"1200\\\\\\\" height=\\\\\\\"674\\\\\\\" /></p>\\\\n<p><strong>前端api截图</strong></p>\\\\n<p><img src=\\\\\\\"http://162.14.98.165:3000/images/1658410625157.png\\\\\\\" alt=\\\\\\\"\\\\\\\" width=\\\\\\\"1200\\\\\\\" height=\\\\\\\"674\\\\\\\" /></p>\\\\n<p><strong>后端api截图</strong></p>\\\\n<p><img src=\\\\\\\"http://162.14.98.165:3000/images/1658410641384.png\\\\\\\" alt=\\\\\\\"\\\\\\\" width=\\\\\\\"1200\\\\\\\" height=\\\\\\\"674\\\\\\\" /></p>\\\\n<p><strong>app预览截图</strong></p>\\\\n<p><img src=\\\\\\\"http://162.14.98.165:3000/images/1658410659261.png\\\\\\\" alt=\\\\\\\"\\\\\\\" width=\\\\\\\"1000\\\\\\\" height=\\\\\\\"562\\\\\\\" /></p>\\\",\\\"comment_count\\\":0,\\\"uname\\\":\\\"unhejing\\\",\\\"desc\\\":\\\"开源node项目介绍，使用express,nestjs,vue3等技术\\\",\\\"is_top\\\":0,\\\"head_img\\\":\\\"http://162.14.98.165:3000/images/1658410699511.png\\\",\\\"created_time\\\":\\\"2022-07-22 07:38:25\\\",\\\"updated_time\\\":\\\"2022-07-21 21:38:25\\\",\\\"cname\\\":\\\"Nodejs编程\\\"},{\\\"id\\\":1,\\\"name\\\":\\\"elasticsearch基本操作API\\\",\\\"uid\\\":0,\\\"cid\\\":10,\\\"status\\\":1,\\\"view_count\\\":0,\\\"like_count\\\":0,\\\"content\\\":\\\"<ul>\\\\n<li><strong>获取索引</strong></li>\\\\n</ul>\\\\n<pre><code class=\\\\\\\"language-bash\\\\\\\">curl &lt;http://localhost:9200/_cat/indices?v&gt;\\\\n</code></pre>\\\\n<ul>\\\\n<li><strong>新建index</strong></li>\\\\n</ul>\\\\n<pre><code class=\\\\\\\"language-bash\\\\\\\">curl -X PUT \'localhost:9200/question\'\\\\n</code></pre>\\\\n<ul>\\\\n<li><strong>设置分词字段</strong></li>\\\\n</ul>\\\\n<pre><code class=\\\\\\\"language-bash\\\\\\\"># todo\\\\n</code></pre>\\\\n<ul>\\\\n<li><strong>设置分片</strong></li>\\\\n</ul>\\\\n<pre><code class=\\\\\\\"language-bash\\\\\\\">curl -H \\\\\\\"Content-Type: application/json\\\\\\\" -X PUT \'&lt;http://localhost:9200/question/_settings?pretty&gt;\' -d \'{\\\\n  \\\\\\\"number_of_replicas\\\\\\\": 0\\\\n}\'\\\\n</code></pre>\\\\n<ul>\\\\n<li><strong>新建文档</strong></li>\\\\n</ul>\\\\n<pre><code class=\\\\\\\"language-bash\\\\\\\">curl -H \\\\\\\"Content-Type: application/json;\\\\\\\" -X PUT &lt;http://localhost:9200/question/_doc/1?pretty&gt; -d \'{\\\\\\\"name\\\\\\\":\\\\\\\"机场排号\\\\\\\"}\' \\\\n\\\\ncurl -H \\\\\\\"Content-Type: application/json;\\\\\\\" -X PUT &lt;http://localhost:9200/question/_doc/2?pretty&gt; -d \'{\\\\\\\"name\\\\\\\":\\\\\\\"在机场停止发号怎么回事\\\\\\\"}\'\\\\n\\\\ncurl -H \\\\\\\"Content-Type: application/json\\\\\\\" -X PUT &lt;http://localhost:9200/question/_doc/3?pretty&gt; -d \'{\\\\\\\"name\\\\\\\":\\\\\\\"helle world\\\\\\\"}\'\\\\n</code></pre>\\\\n<ul>\\\\n<li>查询索引</li>\\\\n</ul>\\\\n<pre><code class=\\\\\\\"language-bash\\\\\\\">curl -H \\\\\\\"Content-Type: application/json\\\\\\\" -X GET localhost:9200/question?pretty\\\\n</code></pre>\\\\n<ul>\\\\n<li><strong>查询具体文档</strong></li>\\\\n</ul>\\\\n<pre><code class=\\\\\\\"language-bash\\\\\\\">curl -XGET localhost:9200/question/_search?pretty\\\\n</code></pre>\\\\n<ul>\\\\n<li><strong>更新文档数据</strong></li>\\\\n</ul>\\\\n<p>1.1 利用POST直接覆盖</p>\\\\n<pre><code class=\\\\\\\"language-bash\\\\\\\">curl -H \\\\\\\"Content-Type: application/json\\\\\\\" -XPOST localhost:9200/question/_doc/3?pretty -d \'{\\\\n\\\\t\\\\\\\"name\\\\\\\":\\\\\\\"hello hello\\\\\\\"\\\\n}\'\\\\n</code></pre>\\\\n<p>1.2 用_update子命令和&rdquo;doc&rdquo;属性来更新：</p>\\\\n<pre><code class=\\\\\\\"language-bash\\\\\\\">curl -H \\\\\\\"Content-Type: application/json\\\\\\\" -XPOST localhost:9200/question/_doc/3/_update?pretty -d \'{\\\\n\\\\\\\"doc\\\\\\\":{\\\\\\\"name\\\\\\\":\\\\\\\"hello3\\\\\\\"}\\\\n}\'\\\\n</code></pre>\\\\n<ul>\\\\n<li><strong>查询文档具体数据</strong></li>\\\\n</ul>\\\\n<pre><code class=\\\\\\\"language-bash\\\\\\\">curl -XGET localhost:9200/question/_doc/1?pretty\\\\n</code></pre>\\\\n<ul>\\\\n<li><strong>查询文档所有内容</strong></li>\\\\n</ul>\\\\n<pre><code class=\\\\\\\"language-bash\\\\\\\">curl -XGET localhost:9200/question/_doc/_search?pretty\\\\n</code></pre>\\\\n<ul>\\\\n<li><strong>带参数查询文档</strong></li>\\\\n</ul>\\\\n<pre><code class=\\\\\\\"language-bash\\\\\\\">curl -H \\\\\\\"Content-Type: application/json\\\\\\\" -XGET localhost:9200/question/_doc/_search?pretty -d\'\\\\n {\\\\n\\\\t \\\\\\\"query\\\\\\\":{\\\\\\\"match\\\\\\\":{\\\\\\\"name\\\\\\\":\\\\\\\"hello4\\\\\\\"}}\\\\n }\'\\\\n</code></pre>\\\\n<ul>\\\\n<li><strong>设置最大查询</strong></li>\\\\n</ul>\\\\n<pre><code class=\\\\\\\"language-bash\\\\\\\">curl -H \\\\\\\"Content-Type: application/json\\\\\\\" -XPUT &lt;http://localhost:9200/question/_settings&gt; -d \'{ \\\\\\\"index\\\\\\\" : { \\\\\\\"max_result_window\\\\\\\" : 100000000}}\'\\\\n</code></pre>\\\\n<ul>\\\\n<li><strong>用_all查询所有索引</strong></li>\\\\n</ul>\\\\n<pre><code class=\\\\\\\"language-bash\\\\\\\">curl -XGET localhost:9200/_all?pretty\\\\n</code></pre>\\\\n<ul>\\\\n<li><strong>.删除记录</strong></li>\\\\n</ul>\\\\n<pre><code class=\\\\\\\"language-bash\\\\\\\">curl -XDELETE localhost:9200/question/_doc/1?pretty\\\\n</code></pre>\\\\n<ul>\\\\n<li><strong>清空索引</strong></li>\\\\n</ul>\\\\n<pre><code class=\\\\\\\"language-jsx\\\\\\\">curl -H \\\\\\\"Content-Type: application/json\\\\\\\" -XPOST localhost:9200/question/_delete_by_query?pretty -d\'\\\\n {\\\\n\\\\t \\\\\\\"query\\\\\\\":{\\\\\\\"match_all\\\\\\\":{}}\\\\n }\'\\\\n</code></pre>\\\\n<ul>\\\\n<li><strong>删除index</strong></li>\\\\n</ul>\\\\n<pre><code class=\\\\\\\"language-bash\\\\\\\">curl -X DELETE \'localhost:9200/question\'\\\\n</code></pre>\\\\n<ul>\\\\n<li><strong>查看分词</strong></li>\\\\n</ul>\\\\n<pre><code class=\\\\\\\"language-bash\\\\\\\">curl -H \\\\\\\"Content-Type: application/json\\\\\\\" -X POST \'&lt;http://localhost:9200/_analyze?pretty&gt;\' -d \'{\\\\n  \\\\\\\"analyzer\\\\\\\": \\\\\\\"ik_smart\\\\\\\",\\\\n  \\\\\\\"text\\\\\\\": \\\\\\\"送机司机排号咋成了普通司机\\\\\\\"\\\\n}\'\\\\n</code></pre>\\\\n<pre><code class=\\\\\\\"language-bash\\\\\\\">curl -H \\\\\\\"Content-Type: application/json\\\\\\\" -X POST \'&lt;http://localhost:9200/_analyze?pretty&gt;\' -d \'{\\\\n  \\\\\\\"analyzer\\\\\\\": \\\\\\\"ik_max_word\\\\\\\",\\\\n  \\\\\\\"text\\\\\\\": \\\\\\\"我在机场\\\\\\\"\\\\n}\'\\\\n</code></pre>\\\\n<ul>\\\\n<li><strong>分词查询</strong></li>\\\\n</ul>\\\\n<pre><code class=\\\\\\\"language-jsx\\\\\\\">/*\\\\n**倒排索引 -&gt; 按照分词匹配。（分词 找 文档）\\\\n**写入数据时会对字段进行分词（按照配置的分词器）存储。\\\\n**match:分词匹配（走分词器，对query分词，然后按照分词后的结果查询）。\\\\n**term:精确查找 （